export const quotes = [
  {
    id: 1,
    quote: "I didn’t want to piss on his battery",
    source: "McCann, S",
  },
  {
    id: 2,
    quote: "Really going to get into the beef and gravy of it today",
    source: "McCann, S",
  },
  {
    id: 3,
    quote:
      "A lie can travel halfway around the world while the truth is putting on its shoes",
    source: "McCann, S",
  },
  {
    id: 4,
    quote:
      "I don’t have an example to show you, but if you go into your minds eye for a moment and imagine it",
    source: "McCann, S",
  },
  {
    id: 5,
    quote: "Feels like I’ve picked up a car instead of using a hammer",
    source: "McCann, S",
  },
];
